INSERT INTO `brands` (`id`, `name`, `description`, `logo`, `poster`, `link`, `slug`) VALUES
(1, 'Calvin Klein Jeans', 'Неизменно актуальная, но современная; классическая, но провокационная одежда. Добро пожаловать на официальный сайт CALVIN KLEIN®. Базовые предметы гардероба для создания ярких образов в любом стиле: от эффектных платьев женской коллекции до соблазнительных купальников и бикини, от футболок и курток мужской коллекции до ярких кроссовок и культовых джинс от CALVIN KLEIN JEANS. Познакомьтесь с коллекцией CALVIN KLEIN UNDERWEAR, в которой представлены лаконичные бралетты с монограммами и мужские боксеры с культовым логотипом на поясе-резинке. Откройте для себя уют и непринужденную роскошь одежды для сна и отдыха. Для ценителей стиля и комфорта во время тренировок, мы предлагаем современная и функциональная CALVIN KLEIN PERFORMANCE.', 'https://hours.se/wp-content/uploads/2017/11/ck-600x600.jpg', '', 'https://www.calvinklein.ru/', 'calvin-klein-jeans'),
(2, 'Tommy Hilfiger', 'С момента запуска своего одноименного бренда в 1985 году Томми Хилфигер стал всемирно известным пионером классического американского стиля. Вдохновленный культовой поп-культурой и наследием Америки, дизайнер и его бренд движимы неизменно оптимистичным видением - нарушить условности и подчеркнуть индивидуальность. Сегодня, под руководством, видением и руководством Hilfiger в качестве главного дизайнера, TOMMY HILFIGER является одним из самых узнаваемых в мире брендов стиля жизни, который разделяет свой инклюзивный и молодой дух с потребителями во всем мире.', 'https://www.starakia.gr/wp-content/uploads/2017/08/tommy.jpg', '', 'https://ru.tommy.com/', 'tommy-hilfiger');
